// admin/components/Sidebar.jsx
import React from "react";
import { NavLink } from "react-router-dom";

export default function Sidebar() {
  return (
    <div className="sidebar bg-dark text-white vh-100 p-3">
      <h4 className="mb-4">
        <i className="fas fa-store me-2"></i>ClothingCo
      </h4>

      <nav className="nav flex-column">
        <NavLink className="nav-link text-white" to="/admin/dashboard">
          <i className="fas fa-home me-2"></i>Dashboard
        </NavLink>
        <NavLink className="nav-link text-white" to="/admin/products">
          <i className="fas fa-box me-2"></i>Products
        </NavLink>
        <NavLink className="nav-link text-white" to="/admin/orders">
          <i className="fas fa-shopping-cart me-2"></i>Orders
        </NavLink>
        <NavLink className="nav-link text-white" to="/admin/customers">
          <i className="fas fa-users me-2"></i>Customers
        </NavLink>
      </nav>
    </div>
  );
}
